    static class SolutionSelf {
        public String minWindow(String s, String t) {
            Map<Character, Integer> window = new HashMap<>();
            Map<Character, Integer> target = new HashMap<>();
            //先将字串读入map
            for (int i = 0; i < t.length(); i++) {
                char c = t.charAt(i);
                target.put(c,target.getOrDefault(c, 0)+ 1);
            }
            int left = 0, right = 0;
            int start = left;
            int minLength = Integer.MAX_VALUE;
            int count = 0;

            while (right < s.length()) {
                //取出右索引指向的字符
                char charRight = s.charAt(right);
                //如果当前字符在t字符串中，就存入window 这个map中并更新计数值
                if (target.containsKey(charRight)) {
                    window.put(charRight, window.getOrDefault(charRight, 0) + 1);
                    //当一个字符的个数与t中同样字符对应的个数相同时，count +1，表示window中当前字符的个数已可覆盖t中相同字符
//                    if (window.get(charRight) == target.get(charRight)) {
//                        count++;
//                    }
                    if (window.get(charRight).equals(target.get(charRight))) {
                        count++;
                    }
                }
                //进行完一系列操作，索引继续右移
                right++;

                //收缩窗口
                //因为字符串t中可能包含重复的字符，所以当window.size() == target.size()，并不能说明当前窗口已完全覆盖字符串t
                //while(window.size() == target.size()){
                while (count == target.size()) {
                    //当前最短子串的长度，就是right-left与minLength的较小者
                    //minLength = Math.min(right-left, minLength);
                    if(right-left <minLength){
                        minLength = right-left;
                        start = left;
                    }
                    char charLeft = s.charAt(left);
                    //left++;
                    //当前左索引指向的字符，t中没有，直接left++跳过
                    if(!target.containsKey(charLeft)){

                        left++;
                        //不能随便重置start。只有当left++后，s的当前子串不再能覆盖t，才说明当前的right---left的覆盖范围是恰能覆盖t的最小范围
                        //start = left;
                    }else {

                        //将当前窗口中有效字符的计数减掉1，因为已不能覆盖t
//                        if(window.get(charLeft)==target.get(charLeft)){
//                            count--;
//                            //start = left;
//                        }
                        if(window.get(charLeft).equals(target.get(charLeft))){
                            count--;
                            //start = left;
                        }
                        //start = left;
                        left ++;
                        window.put(charLeft, window.get(charLeft) - 1);
                    }
                }
            }
            return minLength==Integer.MAX_VALUE?"":s.substring(start, start + minLength);
        }
    }

    static class Solution {
        public String minWindow(String s, String t) {
            Map<Character, Integer> window = new HashMap<>();
            Map<Character, Integer> target = new HashMap<>();
            //先将字串读入map
            for (int i = 0; i < t.length(); i++) {
                char c = t.charAt(i);
                target.put(c,target.getOrDefault(c, 0)+ 1);
            }
            int left = 0, right = 0;
            int start = left;
            int minLength = Integer.MAX_VALUE;
            int count = 0;

            while (right < s.length()) {
                //取出右索引指向的字符
                char charRight = s.charAt(right);
                //如果当前字符在t字符串中，就存入window 这个map中并更新计数值
                if (target.containsKey(charRight)) {
                    window.put(charRight, window.getOrDefault(charRight, 0) + 1);
                    //当一个字符的个数与t中同样字符对应的个数相同时，count +1，表示window中当前字符的个数已可覆盖t中相同字符
                    //巨坑来了，Integer的值不能用==，要用equals方法，即使labuladong已提示这是坑，我还是毅然决然地踩了进去
                    //（==比较的是两个对象是否是同一个，在0-128直接，对象是同一个我记得，超过128就不是同一个了，所以长度小的测试用例可以侥幸通过）
//                    if (window.get(charRight) == target.get(charRight)) {
//                        count++;
//                    }
                    if (window.get(charRight).equals(target.get(charRight))) {
                        count++;
                    }
                }
                //进行完一系列操作，索引继续右移
                right++;

                //收缩窗口
                //因为字符串t中可能包含重复的字符，所以当window.size() == target.size()，并不能说明当前窗口已完全覆盖字符串t，所以要搞个count变量辅助判断
                //while(window.size() == target.size()){
                while (count == target.size()) {
                    //当前最短子串的长度，就是right-left与minLength的较小者
                    //minLength = Math.min(right-left, minLength);
                    if(right-left <minLength){
                        minLength = right-left;
                        //改变start的时机最后放到了这里，这里才是最合理的，注意一下
                        //不能随便重置start。要知道start的作用是记录最小覆盖子串的开头
                        start = left;
                    }

                    char charLeft = s.charAt(left);

                    //当前左索引指向的字符，t中有，进行一些处理
                    if(target.containsKey(charLeft)){
                        //将当前窗口中有效字符的计数减掉1，因为已不能覆盖t
                        if(window.get(charLeft).equals(target.get(charLeft))){
                            count--;
                        }
                        window.put(charLeft, window.get(charLeft) - 1);
                    }

                    //进行完一些操作，左边界右移来缩小窗口
                    left++;
                }
            }
            return minLength==Integer.MAX_VALUE?"":s.substring(start, start + minLength);
        }
    }

    class Solution20240514 {
        public String minWindow(String s, String t) {
            // 需要的字符和个数
            Map<Character, Integer> need = new HashMap<>();
            // 窗口中的字符和个数
            Map<Character, Integer> window = new HashMap<>();
            //先将target读入need
            // 注意4，也是最致命的一处，对比了好几次，发现。。。竟然把t写成了s!!!
            for(int i=0;i<t.length();i++){
                char c = t.charAt(i);
                need.put(c, need.getOrDefault(c, 0) + 1);
            }
            //初始化窗口的左右边界
            int left = 0;
            int right = 0;
            int start = left;//注意1，要记住最小覆盖字串的其实位置，因为left可能不是最小字串的起始位置
            int valid = 0;
            int minLength = Integer.MAX_VALUE;
            //开始滑动窗口
            while(right<s.length()){
                char c = s.charAt(right);
                right++;
                // tips: 注意window最终要达到和need一样的值，而不是所有字符都存
                if(need.containsKey(c)){
                    window.put(c, window.getOrDefault(c,0)+1);
                    //注意3，又掉坑里了，Integer类型，比较值不能用等号要用equals
                    if(window.get(c).equals(need.get(c))){
                        valid ++;
                    }
                }
                //该判断要不要收缩窗口了
                while(valid == need.size()){
                    //注意2，更新最小长度时要同时更新start
                    //minLength=Math.max(minLength, right-left+1);
                    if(right-left < minLength){
                        start = left;
                        minLength = right-left;
                    }
                    char d = s.charAt(left);
                    left ++;
                    if(need.containsKey(d)){
                        //注意3，又掉坑里了，Integer类型，比较值不能用等号要用equals
                        if(need.get(d).equals(window.get(d))){
                            valid--;
                        }
                        window.put(d, window.get(d)-1);
                    }
                }
                //什么时候更新maxLength
            }
            return minLength==Integer.MAX_VALUE?"":s.substring(start, start + minLength);
        }
    }

